import React, { Component } from 'react';

class Searchbox extends Component{
    render(){
        function onSearchChange(event){
            console.log(event.text.value);
        }
        return(
            <div>
                <input 
                type = "search"
                placeholder="Search for robots"
                onChange={onSearchChange}
                />
            </div>
        );
    }
}

export default Searchbox;
